import React from 'react'
import { Link } from 'react-router-dom'

const SidebarElement = (props) => {
    return(
        props.input.map((index, value) => {
            return(
                <React.Fragment>
                    <h1>{props.input.heading}</h1>
                    <Link to={props.input.link} style={link_style}>{props.input.title}</Link>
                </React.Fragment>
            )
        })
    );
}

const link_style = {
    fontSize: "20pt",
    fontWeight: "bold",
    marginLeft: "10%"
}
export default SidebarElement
